import "./TodoEditor.css";

const TodoEditor = () => {
  return (
    <div className="TodoEditor">
      <h4>새로운 Todo 작성하기 ✏️</h4>
      <div className="editor_wrapper">
        <input placeholder="새로운 Todo..." />
        <button></button>
      </div>
    </div>
  );
};

export default TodoEditor;
